import technologicalsupport from '../../Assets/technological-support.png';
import './Home.css';
function Home() {
    return (
        <div className='position-absolute mt-5 start-50 translate-middle-x text-center' >
            <img src={technologicalsupport} className='rounded mx-auto d-block w-100 mt-5' style={{ maxWidth: '200px' }} alt="Technological Support" />
            <h1 className='fw-bold'>Start Framework</h1>
            <p >Graphic Artist - Web Designer - Illustrator</p>
        </div>
    );
}

export default Home;
